import { Container, Row, Col } from 'react-grid-system';


export default () => {
    return <div>
        <style global jsx>{`
        body {
          background: #FCF9E9;
        }
      `}</style>
        <div>
            <Container>
                <Row>
                    <Col md={6}><img src="/logo.svg" /></Col>
                    <Col md={6} style={{ textAlign: "right" }}><a href="#">Terms of Use</a></Col>
                </Row>
            </Container>
        </div>

    </div>
}
